import React from 'react'
import {Swiper, SwiperSlide} from 'swiper/react'
import "swiper/css"


function SwiperCards() {
    
      
  return (
    <div>
        <Swiper>
            <SwiperSlide>Slide 1</SwiperSlide>
        </Swiper>
    </div>
  )
}


export default SwiperCards
